__NUXT_JSONP__("/drugs/Aurora_A_Kinase_Inhibitor_LY3295668", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"An orally bioavailable inhibitor of the serine\u002Fthreonine protein kinase aurora A, with potential antimitotic and antineoplastic activities. Upon administration, aurora A kinase inhibitor LY3295668 targets, binds to and inhibits the activity of aurora A kinase. This may result in disruption of the assembly of the mitotic spindle apparatus, disruption of chromosome segregation, inhibition of cell division and the induction of apoptosis in cells overexpressing aurora A kinase. Aurora A kinase, overexpressed in a wide variety of cancers, plays an essential role in the regulation of spindle assembly and mitosis.",fdaUniiCode:"1WX8O5XV4R",identifier:"C148501",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C62556"],synonyms:["AK 01","AK-01",c,"LY 3295668","LY-3295668","LY3295668"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAurora_A_Kinase_Inhibitor_LY3295668",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Aurora_A_Kinase_Inhibitor_LY3295668","Aurora A Kinase Inhibitor LY3295668","2021-10-30T13:33:12.883Z")));